import logo from "../assets/logo.png";

import React from "react";

function Header() {
  return (
    <nav className="color-[crimson] flex justify-between items-center shadow-xl bg-cyan-200 sticky top-0">
      <img className=" w-20 rounded-full p-2" src={logo} alt="logo" />
      <ul className="flex gap-5">
        <li>
          <a href="#">Home</a>
        </li>
        <li>
          <a href="#">About</a>
        </li>
        <li>
          <a href="#">Contact Us</a>
        </li>
        <button className="bg">Login</button>
        <button>SignUp</button>
      </ul>
    </nav>
  );
}

export default Header;
